import React from 'react';
import { Link } from 'react-router-dom';

import styles from './buttons.module.css';

const buttons = (props) => {
    let template = null;
    switch(props.type){
        case 'loadmore':
            template = null;
            break;
        default:
            template = null;
    }
    return template;
}
export default buttons;
